Herbert Jansch, known as Bert Jansch, was a Scottish folk musician and founding member of the band Pentangle together with John Renbourn. He was born in Glasgow and, in the 1960s, he was heavily influenced by the guitarist Davey Graham and folk singers such as Anne Briggs. He was best known as an innovative and accomplished acoustic guitarist but was also a singer and songwriter.
